import { Carousel } from 'antd';
import './Carousel.less';

const CarouselComponent = ({}) => {
    return (
        <Carousel >
            <div>
                <img src={'https://cdn.pixabay.com/photo/2014/10/22/16/38/ingredients-498199_1280.jpg'} />
            </div>
            <div>
                <h3>2</h3>
            </div>
            <div>
                <h3>3</h3>
            </div>
            <div>
                <h3>4</h3>
            </div>
      </Carousel>
    )
}

export default CarouselComponent;
